import React from 'react';
import './App.css';
import data from './data/medicines.json';
function App() {
  const newdata = data.map(data => {
    return (
      <div className="medicine">
        <img src={data.image} />
        <p>{data.name}</p>
        <p>{data.description}</p>
      </div>
    );
  });
  return (<div className="medicines_list">{newdata}</div>);
}

export default App;
